import './App.css';
import { BrowserRouter as Router, Route, Link, Switch } from "react-router-dom";
import Login from './components/Login/login';

function App() {
    return (
        <Router>
            <Switch>
                <Route path="/" component={Login} />
            </Switch>
        </Router>
    );
}

export default App;
